<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Animated Logo </title>
</head>
<style>
    *{
        margin: 0;
        padding: 0;
    }
    .container{
        height: 100vh;
        width: 100%;
    }
    .logo{
        position: relative;
        margin:auto;
    }
    .svg_logo path{
        /* fill: none; */
        opacity: 1;
        /* stroke-dasharray:550;*/
        /* stroke-dashoffset: 550;  */
        /* stroke: black; */
        stroke-opacity: .8;
        stroke-width: 0.06in;
        /* animation: ease-in-out 5s lineAnimation; */
    }
    .svg_logo path:nth-child(5){
        /* fill: none; */
        /* opacity: 1;
        height: 0; */
        /* stroke-dasharray:550; */
        /* stroke-dashoffset: 550;  */
        /* stroke: black; */
        /* stroke-opacity: .8;
        stroke-width: 0.06in; */
        /* animation: ease-in-out 1s lineAnimation; */
    }
    .first, .second{
        height: 500px;
        position: absolute;
        top: 0; 
        left: 50%;
        transform: translateX(-50%);
        /* margin-top: 50px; */
    }
    .second path:nth-child(n+10):nth-child(-n+20){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 0s;
    }
    .second path:nth-child(n+20):nth-child(-n+30){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: .3s;
    }
    .second path:nth-child(n+30):nth-child(-n+40){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: .6s;
    }
    .second path:nth-child(n+40):nth-child(-n+50){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: .9s;
    }
    .second path:nth-child(n+50):nth-child(-n+60){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 1.2s;
    }
    .second path:nth-child(n+60):nth-child(-n+70){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 1.5s;
    }
    .second path:nth-child(n+70):nth-child(-n+80){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 1.8s;
    }
    .second path:nth-child(n+80):nth-child(-n+90){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 2.1s;
    }
    .second path:nth-child(n+90):nth-child(-n+100){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 2.5s;
    }
    .second path:nth-child(n+100):nth-child(-n+120){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 2.7s;
    }
    .second path:nth-child(n){
        stroke: black;
        stroke-width: 0.06in;
        stroke-dasharray: 1500;
        stroke-dashoffset: 1500;
        animation: 4s ease-in lineAnimation forwards;
        animation-delay: 3.5s;
    }



    .first path:nth-child(n+10):nth-child(-n+20){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 0s;
    }
    .first path:nth-child(n+20):nth-child(-n+30){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: .3s;
    }
    .first path:nth-child(n+30):nth-child(-n+40){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: .6s;
    }
    .first path:nth-child(n+40):nth-child(-n+50){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: .9s;
    }
    .first path:nth-child(n+50):nth-child(-n+60){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 1.2s;
    }
    .first path:nth-child(n+60):nth-child(-n+70){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 1.5s;
    }
    .first path:nth-child(n+70):nth-child(-n+80){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 1.8s;
    }
    .first path:nth-child(n+80):nth-child(-n+90){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 2.1s;
    }
    .first path:nth-child(n+90):nth-child(-n+100){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 2.5s;
    }
    .first path:nth-child(n+100):nth-child(-n+120){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 2.7s;
    }
    .first path:nth-child(n){
        opacity: 0;
        animation: 4s ease-in-out colorAnimation forwards;
        animation-delay: 3.5s;
    }
    /* .first path{ */
        /* opacity: 0; */
        /* animation: 3s ease-in colorAnimation forwards; */
        /* animation-delay: 2s; */
    /* } */
    .second path{
        fill: none;
    }

    @keyframes colorAnimation{
        to{
            opacity: 1;
        }
    }

    @keyframes lineAnimation{
        to{
            stroke-dashoffset: 0;
            stroke-opacity: 0;
        }
    }

</style>
